coords = []
    for obj, *rest in data:
        coords.append(rest)
    coords = np.concatenate(coords, axis=0)

    pca = PCA(n_components=2)
    pca.fit(coords)
    coords_2d = pca.transform(coords)

    if save_plot:
        if plot_path is None:
            raise ValueError("plot_path is not provided")
        else:
            fig, ax = plt.subplots()
            ax.scatter(*coords_2d.T, color="r")
            ax.set_aspect(1)
            fig.savefig(plot_path)
            plt.close(fig)
            return coordinates_2d, ax
    else:
        return np.array(coords_2d)
